// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import './IERC20.sol';

contract BeaverMoon is IERC20 {
  uint256 private _totalSupply;
  mapping(address => uint256) private _balaces;

  function totalSupply() external view returns (uint256) {
    return _totalSupply;
  }


  function balanceOf(address account) external view returns (uint256) {
    return _balaces[account];
  }

  function mint(address account , uint256 amount) public {
    _balaces[account] += amount;
    _totalSupply += amount;
  }

  function _mainTransfer(address from, address to, uint256 amount) private returns (bool) {
    require(amount > 0);
    require(_balaces[from] > amount);
    require(from != to);
    require(from == msg.sender);

    _balaces[from] -= amount;
    _balaces[to] += amount;

    return true;
  }





  function transfer(address to, uint256 amount) external returns (bool) {
    return _mainTransfer(msg.sender, to, amount);
  }

  function transferFrom(
      address from,
      address to,
      uint256 amount
  ) external returns (bool) {
    return _mainTransfer(from, to, amount);
  }





  // Allowance is over our pay-grade ... :) (out of scope)

  function allowance(address owner, address spender) external view returns (uint256) {
    return 0;
  }

  function approve(address spender, uint256 amount) external returns (bool) {
    return false;
  }
}
